const navbarItemsElements = () => {
  var navItems = "";
  for (const navItem of navbarItems()) {
    var navActive = navItem.pageData === "__about" ? "nav__active" : "";
    navItems += `
    <li class="nav-item">
      <span class="nav-link ${navActive}" page-data="${navItem.pageData}">
        ${navItem.title}
      </span>
    </li>`;
  }

  // add mode icon for change theme
  navItems += `
  <li class="nav-item">
    <span class="nav-link mode">
      <img class="mode__icon" mode="light" alt="icon-mode" />
    </span>
  </li>`;

  return navItems;
};

const setMode = (mode) => {
  var body = document.querySelector("body");
  var modeIcon = document.querySelector(".mode__icon");
  var bodyClass, iconSrc, objectModeClass;

  // checking mode
  if (mode === lightModeClass.mode) {
    objectModeClass = lightModeClass;
  } else {
    objectModeClass = darkModeClass;
  }

  bodyClass = objectModeClass.mode;
  revertMode = objectModeClass.revertMode;
  iconSrc = objectModeClass.iconSrc;

  body.setAttribute("class", bodyClass);
  modeIcon.setAttribute("mode", revertMode);
  modeIcon.setAttribute("src", iconSrc);
};
